@MicahCaskey 💯 bro. Right or wrong can be subjective, but being indecent should NOT have ANY place among our elected leaders or anyone - but especially our leaders. 

Debate, persuade, and pass laws that benefit our collective good. 

#leadershipsetsthetone

@AAOCKris Agreed. 

Right now the accountability ball is in the Senate. We, America has to get this right and 44 R Senators didn’t even want to hear the case.  

So, I’m speaking directly to them; they literally have the right or wrong vote to hold Trump accountable. It’s on them.

@Brianpollard80 @SCarolinaMade Sir, please don’t speak on the status of my health or living. It’s dismissive and unnecessary. 

My commitment to my state and country speaks for itself. 

Either Trump was right or wrong for his actions. Accountability or not? The evidence clear - 100 should convict.

