@Adair4Congress You are a superstar, superhero and just flat out super inspiring! 

The example you set for your young ladies will guide them the rest of their lives. 

I’m proud to have met and to share a ballot with you. Job well done!

@JAgeRev Where I’m from, “take the air out your chest” means humble yourself and stop “acting” tough. 

211k + dead and Trump says don’t let the virus dominate you. He’s possibly immune. Have respect for the fallen. 

You shouldn’t appreciate a POTUS who plays politics with American lives

@Donovan_Brock Come on, D. Trump said that he may be immune from the very virus he’s literally ailing from. 

He knew in Feb. the virus is “deadly stuff.” And literally just last night said don’t let the virus dominate your life. 

It’s not about wearing a mask. It’s life or death.

@brandondedmon One is planned with chairs by POTUS. 

The other is in response to the repeated killing of unarmed black folks at the hands of police. 

It’s not the same.

