@USCBrown17 @realDonaldTrump @RepRalphNorman @LindseyGrahamSC @SenatorTimScott @RepJeffDuncan @RepTimmons @RepJoeWilson That’s simple, honor his oath to defend Americans from foreign and domestic threats. 

Absolutely we can do something. Bare minimum, economic sanctions and possibly force if proven Troops were killed. Is this not America? 

I’m not one for talking points. I call it like I see it.

@USCBrown17 @realDonaldTrump @RepRalphNorman @LindseyGrahamSC @SenatorTimScott @RepJeffDuncan @RepTimmons @RepJoeWilson Scott, I love my country and I rarely say stupid stuff. I certainly would NOT make the statement I tweeted without clear thought. 

Can you point to where DTJ has been critical to Putin in the last 4 years?

What has he done about there meddling in 2016 election and now this?

At this point, @realDonaldTrump has made it clear that his allegiance doesn’t rest with the United States of America.

