@TheRealMcWean @BrittonCallie @vitalfinds I endorsed Biden before the SC primary and fully support him. 

But in America, voters can support whomever they please. And there’s too much at stake to get caught up in what “side” anyone person is on. 

I plan to be effective not emotional. We have enough of that.

@vitalfinds Ma’am, I’ll work with either man who wins in Nov to ensure the people of the 5th district are getting their needs met. 

That said, Trump has made it clear he doesn’t care about anyone but himself and how he looks in the media. 

I believe you deserve better leadership.

@KevinGreaves15 @Bugs4US Trust me - it’s not an ask I wish to make given the situation. 

At the same time, it’s exactly why we must keep fighting to elect clear minded leadership that will work endlessly to prevent this from happening again. 

We must stay resolved in Restoring American Leadership.

